import React from 'react';


const Navba =()=>{
    return(
        <header className="jsx-207749059 main-header "><div className="jsx-207749059 header-guide guide"><div className="jsx-1497814479 default-logo-container"><a aria-label="Coin Stats" className="jsx-1497814479 icon-logo" href="/" /></div><div className="jsx-207749059 header-wrapper show-desktop"><div className="jsx-207749059 header-inner-wrapper"><span className="secondary-label ">LIGHT</span><label className="toggle-switch false"><input alt type="checkbox" /><span className="switcher-check"><i /></span></label><nav className="jsx-207749059 nav-items"><a className="primary-nav    portfolio-tab" href="/de/portfolio" target="_self" rel="noopener" title="Connect exchange, wallet accounts  
  or manually add transactions ">Portfolio Tracker</a><a className="primary-nav   active " target="_self" title="View the list of your coins with 
  the details important to you " href="/de/">Live-Preise</a><a className="primary-nav    " target="_self" href="/de/pricing/">Pricing</a><a className="primary-nav    " target="_self" href="/de/alerts/">Alarme</a></nav><div className="jsx-207749059 open-close-wrapper"><span className="jsx-207749059 icon-more_big open-close " /></div><div className="jsx-207749059 header-divider" /><div className="jsx-207749059 search-dropdowns-container closed-searchbar"><div className="jsx-2262109736 dropdown  "><div className="jsx-2262109736 dropdown-placeholder"><span className="primary-nav    ">USD</span><span className="jsx-2262109736 icon-dropdown_arrow close" /></div></div><div className="jsx-2262109736 dropdown  "><div className="jsx-2262109736 dropdown-placeholder"><span className="primary-nav    ">DE</span><span className="jsx-2262109736 icon-dropdown_arrow close" /></div></div><div className="search-wrapper"><div className="jsx-550402856 search-result"><div className="jsx-550402856 input-wrapper"><div className="jsx-1485860805 text-box-wrapper "><input type="text" placeholder="Suche" name className="jsx-1485860805 text-box" defaultValue /><span className="jsx-1485860805 icon-search" /></div></div></div></div></div><a className="button-with-link" href="/de/login-email/"><button type="button" id className="jsx-1426819953 standart-button login-button text">Login</button></a><a className="button-with-link" href="/de/login/"><button type="button" id className="jsx-1426819953 standart-button  primary">Los gehtâ€™s</button></a></div></div></div></header>

    )
}

export default Navba;
